import Item from "./Item"

function ItemList ({items, setItemView}){
    // console.log(items)
    return (
        <div className="itemlist">
            {items.map((item) =>(
                <Item key ={item.id} item={item} setItemView={setItemView} />
            ))}
        </div>
    )
}

export default ItemList
